import logo from './logo.svg';
import { BrowserRouter, Route, Switch } from 'react-router-dom';
import './App.css';
import Header from './Components/Header/Header';
import Home from './Pages/Home/Home';
import About from './Pages/About/About';
import Login from './Pages/Login/Login';
import Register from './Pages/Register/Register';
import DemoApiClass from './Pages/DemoApi/DemoApiClass';
import DemoFunctionApi from './Pages/DemoApi/DemoFunctionApi';
import Detail from './Pages/Detail/Detail';
import { Fragment } from "react";
import HomeTemplate from './Templates/HomeTemplates/HomeTemplate';

function App() {
  return (
    <BrowserRouter>
      <div className="App">

        <Switch>

          <HomeTemplate path="/home" component={Home} />

          <Route path="/home" exact render={(props) => {
            return <div>
              <Header {...props} /> {/*location, history, match */}
              <Home {...props} /> {/*location, history, match */}
            </div>
          }} />
          <Route path="/login" exact render={(propsRoute) => {
            return (
              <div className="container">
                <h1>Login</h1>
                <Login {...propsRoute} />
              </div>
            );
          }} />
          <Route path="/register" exact component={Register} />
          <Route path="/about" exact component={About} />
          <Route path="/" exact component={Home} />
          <Route path="/DemoApiClass" exact component={DemoApiClass} />
          <Route path="/DemoFunctionApi" exact component={DemoFunctionApi} />
          <Route path="/detail/:id" exact render={(propsRoute) => {
            return (
              <Fragment>
                <Header {...propsRoute} />
                <Detail {...propsRoute} />
              </Fragment>
            )
          }} />

        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
